import React from 'react'
import Sdata from './Sdata';
import Card from './Card';



const App = () => (
    <>
    {
        Sdata.map((val) => {
            return (
                <Card
                    key={val.id}
                    imgsrc={val.imgsrc}
                    cardTitle={val.cardTitle}
                    link={val.link}
                />
            )
        })}
    </>

)

export default App;
